import React from "react";
import Dialog from "./Dialog";

export default function Login() {
  return (
    <div>
      <div
        style={{
          backgroundColor: "green",
          height: "185px",
          width: "100%",

          zIndex: "-5",
        }}
      ></div>
      <div style={{ marginTop: "185px", position: "absolute", width: "100%" }}>
        <Dialog />
      </div>
    </div>
  );
}
